import React from 'react'
import { BrowserRouter, Routes, Route } from 'react-router-dom'
import Main from './AppFlow/MainScreen/Main'

export default function App() {
    return (
            <Routes>
                <Route path='/' element={<Main/>}/>
            </Routes>
    )
}
